create table clients (
	id INT,
	client_id INT,
	atp_id VARCHAR(50),
	physician_id VARCHAR(50),
	therapist_id VARCHAR(50),
	assessment_id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	middle_name VARCHAR(50),
	generation VARCHAR(50),
	dob DATE,
	gender VARCHAR(50),
	address VARCHAR(50),
	city VARCHAR(50),
	state VARCHAR(50),
	zip VARCHAR(50),
	caregiver_name INT,
	caregiver_relationship VARCHAR(50),
	email VARCHAR(50),
	phone VARCHAR(50),
	medicaid_payor VARCHAR(10),
	medicaid_id VARCHAR(50),
	medicare_id VARCHAR(50),
	death_date DATE,
	isActive VARCHAR(5),
	private1_payor VARCHAR(5),
	private1_id VARCHAR(50),
	private2_payor VARCHAR(5),
	private2_id VARCHAR(50)
);
